code.value:
rfeSwBist_BistLocalParams_t bistLocalParam;

uint32_t enableBist = rfeSwFuSaMngr_getEnabledBistComponents( RFE_ERROR_FUNCTION_ARGUMENT );
uint32_t enableBistLldo = rfeSwFuSaMngr_getEnabledBistComponents( RFE_ERROR_FUNCTION_ARGUMENT );
uint32_t lldoEnableMask = ( ( 1 <<  rfeSwFusaMngr_enable_chirppll_ldo_vco_1v8_e ) | \
                          ( 1 <<  rfeSwFusaMngr_enable_chirppll_ldo_vco_0v9_e ) | \
                          ( 1 <<  rfeSwFusaMngr_enable_chirppll_ldo_pfdcp_1v8_e ) | \
                          ( 1 <<  rfeSwFusaMngr_enable_chirppll_ldo_pfdcp_0v9_e ) | \
                          ( 1 <<  rfeSwFusaMngr_enable_chirppll_ldo_pdiv_0v9_e ) | \
                          ( 1 <<  rfeSwFusaMngr_enable_ldo_xo_out_e ) | \
                          ( 1 <<  rfeSwFusaMngr_enable_ldo_mcgen_e ) | \
                          ( 1 <<  rfeSwFusaMngr_enable_ldo_dco_capbank_e ) | \
                          ( 1 <<  rfeSwFusaMngr_enable_ldo_div3_e ) | \
                          ( 1 <<  rfeSwFusaMngr_enable_ldo_digital_e ) | \
                          ( 1 <<  rfeSwFusaMngr_enable_ldo_dco_buffer_e ) | \
                          ( 1 <<  rfeSwFusaMngr_enable_ldo_sampler_e ) | \
                          ( 1 <<  rfeSwFusaMngr_enable_ldo_xo_core_e ) );

if ( ( enableBistLldo & lldoEnableMask ) != 0u )
{
    rfeSwBist_lldoBist( enableBistLldo, RFE_ERROR_FUNCTION_ARGUMENT );
}

bool zeroHourMeasurement = false;
bool phaseDifferenceTest = true;
bool phaseStepTest = true;

uint32_t txBistEnabled = ( ( 1u << rfeSwFusaMngr_enable_txbistPhaseDiff_e ) | ( 1u << rfeSwFusaMngr_enable_txbistPhaseStep_e ) );
if( ( txBistEnabled & enableBist ) != 0u )
{
    rfeSwBist_txBist( pTxBistParam,
                      phaseDifferenceTest,
                      phaseStepTest,
                      zeroHourMeasurement,
                      RFE_ERROR_FUNCTION_ARGUMENT );
}

uint32_t rxBistEnabled = ( 1u << rfeSwFusaMngr_enable_rxbist_e );
if ( ( rxBistEnabled & enableBist ) != 0u )
{
    rfeSwBist_rxBistInit( RFE_ERROR_FUNCTION_ARGUMENT );
    rfeSwBist_rxBist( pRxBistParam,
                      false, 
                      RFE_ERROR_FUNCTION_ARGUMENT );
}

/* rxBistParam, txBistParam */
RFE_ERROR_GUARD
{
    if (( pTxReferenceData  == NULL ) || ( pRxReferenceData == NULL ))
    {
        RFE_ERROR_SET( rfe_error_parameterOutOfRange_e );
    }
    else
    {
        // All parameters within range
    }
}

RFE_ERROR_GUARD
{
    uint32_t enableBist = rfeSwFuSaMngr_getEnabledBistComponents( RFE_ERROR_FUNCTION_ARGUMENT );
    uint32_t txBistEnabled = ( ( 1u << rfeSwFusaMngr_enable_txbistPhaseDiff_e ) | ( 1u << rfeSwFusaMngr_enable_txbistPhaseStep_e ) );
    uint32_t rxBistEnabled = ( 1u << rfeSwFusaMngr_enable_rxbist_e );
    // initializing variables
    pTxReferenceData->txPhaseDiff[rfe_txIndex_1_e] = 0x0;
    pTxReferenceData->txPhaseDiff[rfe_txIndex_2_e] = 0x0;
    pTxReferenceData->txPhaseDiff[rfe_txIndex_3_e] = 0x0;
    pTxReferenceData->txPowerLevelForBist = 0x0;
    pTxReferenceData->txFrequencyForBist = pTxBistParam->txFrequencyForBist;

    pRxReferenceData->rxFrequencyForBist = pTxBistParam->txFrequencyForBist;
    pRxReferenceData->rxPhaseDiff[rfe_rxIndex_1_e] =  0x0;
    pRxReferenceData->rxPhaseDiff[rfe_rxIndex_2_e] =  0x0;
    pRxReferenceData->rxPhaseDiff[rfe_rxIndex_3_e] =  0x0;
    pRxReferenceData->rxGainDiff[rfe_rxIndex_1_e] =  0x0;
    pRxReferenceData->rxGainDiff[rfe_rxIndex_2_e] =  0x0;
    pRxReferenceData->rxGainDiff[rfe_rxIndex_3_e] =  0x0;
    pRxReferenceData->injectTestToneBeforeLna = true;

    if( ( ( rxBistEnabled | txBistEnabled ) & enableBist ) != 0u )
    {
        bool zeroHourMeasurement = true;
        bool phaseDifferenceTest = true;
        bool phaseStepTest = false;

        rfeSwPwrMngr_pdcOffToOn( RFE_ERROR_FUNCTION_ARGUMENT );
        rfeSwPwrMngr_offToStandby( rfe_role_standalone_e, RFE_ERROR_FUNCTION_ARGUMENT );
        rfeSwPwrMngr_standbyToOn( rfe_role_standalone_e, pTxBistParam->selectedTxs, RFE_RX_SELECT_ALL, RFE_ERROR_FUNCTION_ARGUMENT );

        /********************** TX BIST  ************************/
        if( ( txBistEnabled & enableBist ) != 0u )
        {
            rfeSwBist_txBist( pTxBistParam,
                              phaseDifferenceTest,
                              phaseStepTest,
                              zeroHourMeasurement,
                              RFE_ERROR_FUNCTION_ARGUMENT );

            pTxReferenceData->txPhaseDiff[rfe_txIndex_1_e] = BIST_PHASE_GAIN_FLOAT_TO_INT16( pTxBistParam->zeroHourPhaseMeas[rfe_txIndex_1_e] );

            pTxReferenceData->txPhaseDiff[rfe_txIndex_2_e] = BIST_PHASE_GAIN_FLOAT_TO_INT16( pTxBistParam->zeroHourPhaseMeas[rfe_txIndex_2_e] );

            pTxReferenceData->txPhaseDiff[rfe_txIndex_3_e] = BIST_PHASE_GAIN_FLOAT_TO_INT16( pTxBistParam->zeroHourPhaseMeas[rfe_txIndex_3_e] );

            pTxReferenceData->txPowerLevelForBist = ( int16_t )( pTxBistParam->targetPower * RFE_TX_POWER_1_DB );
        }

        /**********************  RX BIST  ************************/
        if( ( rxBistEnabled & enableBist ) != 0u )
        {
            rfeSwBist_rxBistInit( RFE_ERROR_FUNCTION_ARGUMENT );
            rfeSwBist_rxBist( pRxBistParam,
                              true, 
                              RFE_ERROR_FUNCTION_ARGUMENT );

            pRxReferenceData->rxPhaseDiff[rfe_rxIndex_1_e] = BIST_PHASE_GAIN_FLOAT_TO_INT16( pRxBistParam->zeroDayMeasurementBuff.phDiff1[rfe_rxIndex_1_e] );
            pRxReferenceData->rxPhaseDiff[rfe_rxIndex_2_e] = BIST_PHASE_GAIN_FLOAT_TO_INT16( pRxBistParam->zeroDayMeasurementBuff.phDiff1[rfe_rxIndex_2_e] );
            pRxReferenceData->rxPhaseDiff[rfe_rxIndex_3_e] = BIST_PHASE_GAIN_FLOAT_TO_INT16( pRxBistParam->zeroDayMeasurementBuff.phDiff1[rfe_rxIndex_3_e] );
            pRxReferenceData->rxGainDiff[rfe_rxIndex_1_e] = BIST_PHASE_GAIN_FLOAT_TO_INT16( pRxBistParam->zeroDayMeasurementBuff.G1[rfe_rxIndex_1_e] );
            pRxReferenceData->rxGainDiff[rfe_rxIndex_2_e] = BIST_PHASE_GAIN_FLOAT_TO_INT16( pRxBistParam->zeroDayMeasurementBuff.G1[rfe_rxIndex_2_e] );
            pRxReferenceData->rxGainDiff[rfe_rxIndex_3_e] = BIST_PHASE_GAIN_FLOAT_TO_INT16( pRxBistParam->zeroDayMeasurementBuff.G1[rfe_rxIndex_3_e] );
            if ( pRxBistParam->rxBistInjectToneBeforeLna == rfe_rxBist_lnaTest_e )
            {
                pRxReferenceData->injectTestToneBeforeLna = true; 
            }
            else
            {
                pRxReferenceData->injectTestToneBeforeLna = false; 
            }
        }
        rfeSwPwrMngr_onToStandby( rfe_role_standalone_e, pTxBistParam->selectedTxs, RFE_RX_SELECT_ALL, RFE_ERROR_FUNCTION_ARGUMENT );
        rfeSwPwrMngr_standbyToOff( rfe_role_standalone_e, RFE_ERROR_FUNCTION_ARGUMENT );
        rfeSwPwrMngr_pdcOnToOff( RFE_ERROR_FUNCTION_ARGUMENT );
    }
}

#ifdef RFE_HW_ENABLE_RANGE_CHECK
    RFE_ERROR_GUARD
    {
        if ( ( ( pRxBistParam->rxBistInjectToneBeforeLna != rfe_rxBist_lnaTest_e ) && ( pRxBistParam->rxBistInjectToneBeforeLna != rfe_rxBist_mixerTest_e ) ) ||
             ( ( zeroDayMeasurement != true ) && ( zeroDayMeasurement != false ) )
        )
        {
            RFE_ERROR_SET( rfe_error_rxbistParameterOutOfRange_e );
        }
        else
        {
            // All parameters within range
        }
    }
#endif
    RFE_ERROR_GUARD
    {        
        rfeSwBist_BistLocalParams_t rxBistLocalParam;

        rxBistLocalParam.rxBistTones.v1 = RFE_SW_RXBIST_TONE_1_VOLTAGE_MV;
        rxBistLocalParam.rxBistTones.v2 = RFE_SW_RXBIST_TONE_2_VOLTAGE_MV;
        rxBistLocalParam.rxBistTones.f1 =  RFE_SW_RXBIST_TONE_1_FREQUENCY_HZ;
        rxBistLocalParam.rxBistTones.f2 = RFE_SW_RXBIST_TONE_2_FREQUENCY_HZ;
        rxBistLocalParam.rxBistTones.ph1 = RFE_SW_RXBIST_TONE_1_PHASE_DEG;
        rxBistLocalParam.rxBistTones.ph2 = RFE_SW_RXBIST_TONE_2_PHASE_DEG;

        rxBistLocalParam.swBistFftSize = RFE_SW_BIST_SAMPLE_NUMBER;
        rxBistLocalParam.swBistSamplingRate = RFE_SW_BIST_SAMPLING_RATE;
        rxBistLocalParam.pdcBitWidth = rfe_pdcBitwidth_16bit_e;
        rxBistLocalParam.rxBistPdcBackupBitWidth = rfe_pdcBitwidth_16bit_e;
        rxBistLocalParam.swBistDataBuff = ( rfeHwReg_register32_t )( &rfeSwCalibration_rxSamplesForCalibration[0] );

        rfeSwBist_rxBistSetup( &rxBistLocalParam, pRxBistParam, RFE_ERROR_FUNCTION_ARGUMENT );

        rfeSwBist_rxBistSignalPathSelect( pRxBistParam->rxBistInjectToneBeforeLna, RFE_ERROR_FUNCTION_ARGUMENT );

        rfeSwBist_rxBistAcquisition( RFE_ERROR_FUNCTION_ARGUMENT );

        rfeSwBist_rxBistPostProcessing( &rxBistLocalParam,
                                        pRxBistParam, 
                                        RFE_ERROR_FUNCTION_ARGUMENT );

        rfeSwBist_rxBistPhaseCheck( &rxBistLocalParam,
                                    pRxBistParam,
                                    zeroDayMeasurement,
                                    RFE_ERROR_FUNCTION_ARGUMENT );

        rfeSwBist_rxBistAmplitudeCheck( &rxBistLocalParam,
                                        pRxBistParam,
                                        zeroDayMeasurement,
                                        RFE_ERROR_FUNCTION_ARGUMENT );

        rfeSwBist_rxBistRevertSetup( &rxBistLocalParam, RFE_ERROR_FUNCTION_ARGUMENT );
    }

/*
 * Parameters to configure ATB DC bus to be used
 */
rfeHwAtb_atbSource_t atbInputSource = rfeHwAtb_atbSource_dc1_e;
rfeHwAtb_adcInputMuxer_VNeg_SE_Selector_t adcSingleModeGround = rfeHwAtb_adcInputMuxer_VNeg_SE_Selector_vNegative_e; // We are working in differential, this variable will be ignored by ATB driver
/*
 * Parameters to configure ATB ADC
 */
// ATB ADC basic settings
if ( LldoCheck )
{
    pAdcSettingsForBist->adcCurrentSamplingRate = rfeHwAtb_adcSamplingRate_2p5M_e; // use max fs=2.5MHz
    pAdcSettingsForBist->adcCurrentDutyCycle = rfeHwAtb_adcDutyCycle_75_e;         // 75% Duty Cycle
    pAdcSettingsForBist->adcAverageEnabled = rfeHwAtb_adcAverageEnable_enabled_e;  // enable average
    pAdcSettingsForBist->adcAverageMode = rfeHwAtb_adcAverageMode_cont_e;          // Sample in mono mode
    pAdcSettingsForBist->adcSamplesToAverage = rfeHwAtb_adcAveragingOn_4samples_e; // 4-sample or other averaging
    pAdcSettingsForBist->adcInputGain = RFE_SWBist_LLDOBIST_ADC_GAIN_MODE;               // Check adcGainMode according, we use div2 mode as the LLDOs voltage is greater than 0.7V
    // ATB ADC grounding settings
    // ADC End settings
    pAdcSettingsForBist->adcEndingMode = RFE_SWBist_ADC_ENDING_MODE;
    pAdcSettingsForBist->adcSelectedInput = RFE_SWBist_LLDOBIST_ADC_INNER_SEL;      // ADC_SEL=0x00 imposes MUX_P=0x02
}
else
{
    pAdcSettingsForBist->adcCurrentSamplingRate = rfeHwAtb_adcSamplingRate_5M_e;   // use max fs=5MHz
    pAdcSettingsForBist->adcCurrentDutyCycle = rfeHwAtb_adcDutyCycle_50_e;         // 50% Duty Cycle
    pAdcSettingsForBist->adcAverageEnabled = rfeHwAtb_adcAverageEnable_enabled_e;  // enable average
    pAdcSettingsForBist->adcAverageMode = rfeHwAtb_adcAverageMode_cont_e;          // Sample in continuous mode
    pAdcSettingsForBist->adcSamplesToAverage = rfeHwAtb_adcAveragingOn_4samples_e; // 4-sample or other averaging
    pAdcSettingsForBist->adcInputGain = RFE_SWBist_TXBIST_ADC_GAIN_MODE;             // Check adcGainMode according, we use div2 mode as the LLDO voltage is greater than 0.7V
    // ATB ADC grounding settings
    // ADC End settings
    pAdcSettingsForBist->adcEndingMode = RFE_SWBist_ADC_ENDING_MODE;
    pAdcSettingsForBist->adcSelectedInput = rfeHwAtb_adcInner_Sel_In_0;      // ADC_SEL=0x00 imposes MUX_P=0x02
}


// Configure basic settings of the ATB ADC
rfeHwAtb_ctrlAtbAdcBasicSettingsSetter( selectedAtbX,
                                        pAdcSettingsForBist->adcCurrentSamplingRate,
                                        pAdcSettingsForBist->adcCurrentDutyCycle,
                                        pAdcSettingsForBist->adcAverageEnabled,
                                        pAdcSettingsForBist->adcAverageMode,
                                        pAdcSettingsForBist->adcSamplesToAverage,
                                        RFE_ERROR_FUNCTION_ARGUMENT );

// Configure ATB ADC settings for grounding and input
rfeHwAtb_ctrlAtbAdcModeSetter( selectedAtbX,
                               pAdcSettingsForBist->adcSelectedInput,
                               pAdcSettingsForBist->adcEndingMode,
                               adcSingleModeGround,
                               pAdcSettingsForBist->adcInputGain,
                               RFE_ERROR_FUNCTION_ARGUMENT );

// Connect output signal to ATB ADC bus;
bool enableInputToATB = true;
rfeHwAtb_ctrlAtbDcInputSourceSetter( selectedAtbX,
                                     atbInputSource,
                                     enableInputToATB,
                                     RFE_ERROR_FUNCTION_ARGUMENT );
// Disable ATB DC bus pulldown lines
enableInputToATB = true;
rfeHwAtb_ctrlAtbPullDownLinesSetter( atbInputSource,
                                     enableInputToATB,
                                     RFE_ERROR_FUNCTION_ARGUMENT );

float voltage;
rfeHwAtb_adcSettings_t adcSettingsForBist;
rfeHwTSense_startTemperatureConversion( rfe_temperatureSensorIndex_xo_e, true, RFE_ERROR_FUNCTION_ARGUMENT );
rfeSwBist_configureAtbForBist( true,
                               rfeHwAtb_atbMaster_1_e,
                               &adcSettingsForBist,
                               RFE_ERROR_FUNCTION_ARGUMENT );
rfeSwBist_configureAtbForBist( true,
                               rfeHwAtb_atbMaster_2_e,
                               &adcSettingsForBist,
                               RFE_ERROR_FUNCTION_ARGUMENT );

for ( rfeSwBist_lldoId_t LldoInd = rfeSwBist_Id_chirppll_ldo_vco_1v8_e; LldoInd < rfeSwBist_Id_ldo_div3_e; LldoInd++ )
{
    if ( ( ( 1u << LldoInd ) & enableBistLldo ) != 0u )
    {
        voltage = ( float ) rfeSwBist_measureLldoVoltage( LldoInd,
                                                          RFE_ERROR_FUNCTION_ARGUMENT );
        rfeSwBist_checkAndThrowErrorForLldo( LldoInd,
                                             voltage,
                                             RFE_ERROR_FUNCTION_ARGUMENT );
    }
}

uint8_t txBistInd;
bool doExtraMeasureForPhaseStep = false;
rfeHwAtb_adcSettings_t adcSettingsForBist;

RFE_ERROR_GUARD
{
    rfeSwBist_BistLocalParams_t txBistLocalParam;
    // Workaround STRX-7392: it needs to enable TX buf2b2c and PR buffer to avoid GLDO1V3 undershoot in profile switch.
    rfeHwTx_setTxBuf2b2cInAllTxsToAvoidGLDO2UndershootInPowerOn( ptxBistParam->selectedTxs, RFE_ERROR_FUNCTION_ARGUMENT );
    rfeHw_tuneGldo_loadProfile( rfeHw_profileIndex_bist_e,
                                RFE_ERROR_FUNCTION_ARGUMENT );
    rfeSwBist_txLoBiasPaEnable( ptxBistParam->selectedTxs,
                                true,
                                RFE_ERROR_FUNCTION_ARGUMENT );
    rfeHwTx_transmissionEnable( ptxBistParam->selectedTxs,
                                true,
                                RFE_ERROR_FUNCTION_ARGUMENT );
    rfeHwChirppll_calibratedToPllLockedCwMode( RFE_ERROR_FUNCTION_ARGUMENT );
    rfeSwBist_configureAtbForBist( false,
                                   rfeHwAtb_atbMaster_2_e,
                                   &adcSettingsForBist,
                                   RFE_ERROR_FUNCTION_ARGUMENT );
    switch ( ptxBistParam->selectedTxs )
    {
    case 3ul:  // Tx1 and Tx2 enabled
    case 11ul: // Tx1, Tx2 and Tx4 enabled
        rfeSwBist_calculateTxBistParameters( ptxBistParam,
                                             zeroHourMeasurement,
                                             phaseDifferenceTest,
                                             phaseStepTest,
                                             doExtraMeasureForPhaseStep,
                                             rfeSwBist_txBistIndex_1_e,
                                             RFE_ERROR_FUNCTION_ARGUMENT );

        if ( phaseStepTest == true )
        {
            doExtraMeasureForPhaseStep = true;
            rfeSwBist_calculateTxBistParameters( ptxBistParam,
                                                 zeroHourMeasurement,
                                                 phaseDifferenceTest,
                                                 phaseStepTest,
                                                 doExtraMeasureForPhaseStep,
                                                 rfeSwBist_txBistIndex_1_e,
                                                 RFE_ERROR_FUNCTION_ARGUMENT );
        }
        break;
    case 6ul: // Tx2 and Tx3 enabled
        rfeSwBist_calculateTxBistParameters( ptxBistParam,
                                             zeroHourMeasurement,
                                             phaseDifferenceTest,
                                             phaseStepTest,
                                             doExtraMeasureForPhaseStep,
                                             rfeSwBist_txBistIndex_2_e,
                                             RFE_ERROR_FUNCTION_ARGUMENT );
        if ( phaseStepTest == true )
        {
            doExtraMeasureForPhaseStep = true;
            rfeSwBist_calculateTxBistParameters( ptxBistParam,
                                                 zeroHourMeasurement,
                                                 phaseDifferenceTest,
                                                 phaseStepTest,
                                                 doExtraMeasureForPhaseStep,
                                                 rfeSwBist_txBistIndex_2_e,
                                                 RFE_ERROR_FUNCTION_ARGUMENT );
        }
        break;

    case 7ul: // Tx1, Tx2 and Tx3 enabled
        for (txBistInd = 0; txBistInd < RFE_SW_BIST_TXBIST_COUNT - 1; txBistInd++)
        {
            rfeSwBist_calculateTxBistParameters( ptxBistParam,
                                                 zeroHourMeasurement,
                                                 phaseDifferenceTest,
                                                 phaseStepTest,
                                                 doExtraMeasureForPhaseStep,
                                                 txBistInd,
                                                 RFE_ERROR_FUNCTION_ARGUMENT );
        }
        if ( phaseStepTest == true )
        {
            doExtraMeasureForPhaseStep = true;
            rfeSwBist_calculateTxBistParameters( ptxBistParam,
                                                 zeroHourMeasurement,
                                                 phaseDifferenceTest,
                                                 phaseStepTest,
                                                 doExtraMeasureForPhaseStep,
                                                 rfeSwBist_txBistIndex_1_e,
                                                 RFE_ERROR_FUNCTION_ARGUMENT );
        }
        break;

    case 12ul: // Tx3 and Tx4 enabled
    case 13ul: // Tx1,Tx3 and Tx4 enabled
        rfeSwBist_calculateTxBistParameters( ptxBistParam,
                                             zeroHourMeasurement,
                                             phaseDifferenceTest,
                                             phaseStepTest,
                                             doExtraMeasureForPhaseStep,
                                             rfeSwBist_txBistIndex_3_e,
                                             RFE_ERROR_FUNCTION_ARGUMENT );
        if ( phaseStepTest == true )
        {
            doExtraMeasureForPhaseStep = true;
            rfeSwBist_calculateTxBistParameters( ptxBistParam,
                                                 zeroHourMeasurement,
                                                 phaseDifferenceTest,
                                                 phaseStepTest,
                                                 doExtraMeasureForPhaseStep,
                                                 rfeSwBist_txBistIndex_3_e,
                                                 RFE_ERROR_FUNCTION_ARGUMENT );
        }
        break;

    case 14ul: // Tx2,Tx3 and Tx4 enabled
        for ( txBistInd = 1; txBistInd < RFE_SW_BIST_TXBIST_COUNT; txBistInd++ )
        {
            rfeSwBist_calculateTxBistParameters( ptxBistParam,
                                                 zeroHourMeasurement,
                                                 phaseDifferenceTest,
                                                 phaseStepTest,
                                                 doExtraMeasureForPhaseStep,
                                                 txBistInd,
                                                 RFE_ERROR_FUNCTION_ARGUMENT );
        }
        if ( phaseStepTest == true )
        {
            doExtraMeasureForPhaseStep = true;
            rfeSwBist_calculateTxBistParameters( ptxBistParam,
                                                 zeroHourMeasurement,
                                                 phaseDifferenceTest,
                                                 phaseStepTest,
                                                 doExtraMeasureForPhaseStep,
                                                 rfeSwBist_txBistIndex_2_e,
                                                 RFE_ERROR_FUNCTION_ARGUMENT );
        }
        break;
    case 15ul: // all Txs enabled
        for (txBistInd = 0; txBistInd < RFE_SW_BIST_TXBIST_COUNT; txBistInd++)
        {
            rfeSwBist_calculateTxBistParameters( ptxBistParam,
                                                 zeroHourMeasurement,
                                                 phaseDifferenceTest,
                                                 phaseStepTest,
                                                 doExtraMeasureForPhaseStep,
                                                 txBistInd,
                                                 RFE_ERROR_FUNCTION_ARGUMENT );
        }
        if ( phaseStepTest == true )
        {
            doExtraMeasureForPhaseStep = true;
            rfeSwBist_calculateTxBistParameters( ptxBistParam,
                                                 zeroHourMeasurement,
                                                 phaseDifferenceTest,
                                                 phaseStepTest,
                                                 doExtraMeasureForPhaseStep,
                                                 rfeSwBist_txBistIndex_1_e,
                                                 RFE_ERROR_FUNCTION_ARGUMENT );
        }
        break;
    default:
        RFE_ERROR_GUARD
        {
            // Do nothing
        }
        break;
    }
    rfeHwTx_transmissionEnable( ptxBistParam->selectedTxs,
                                false,
                                RFE_ERROR_FUNCTION_ARGUMENT );
    rfeSwBist_txLoBiasPaEnable( ptxBistParam->selectedTxs,
                                false,
                                RFE_ERROR_FUNCTION_ARGUMENT );
}

if( !rfeHwPdc_getMulticastModeOn() )
{
    rfeHwPdc_multicastModeSetter( true, RFE_ERROR_FUNCTION_ARGUMENT );
}
else
{
    // Nothing  PDC multicast is already on
}
