                             rfeHw_profileIndex_bist_e,
                             RFE_SW_RXBIST_EFFCTIVE_SAMPLING_FREQ,
                             RFE_ERROR_FUNCTION_ARGUMENT );

// STRX-STRX-7319 : HW Bug, PDC IQ correction is needed to avoid mismatching impacting on RX IF transition
#ifdef RFE_HW_PDC_ES1
rfeHwPdc_dftSamplingFrequency_t pdcSamplingRate = rfeHwPdc_samplingRatesMapper( RFE_SW_RXBIST_EFFCTIVE_SAMPLING_FREQ, RFE_ERROR_FUNCTION_ARGUMENT );

rfeHwPdc_funcOverrideDefaultPhaseCorrectionValues( ( rfeHw_profileIndex_t ) rfeHw_profileIndex_bist_e,
                                                    pdcSamplingRate,
                                                    pdcFilterMode,
                                                    RFE_ERROR_FUNCTION_ARGUMENT );
#endif // RFE_HW_PDC_ES1

rfeHw_profileIndex_t chirpProfileIndex = rfeHw_profileIndex_bist_e;
rfeHwTe_chirpProfileParams_t teChirpProfile;
teChirpProfile.dwellTimeTicks = RFE_SW_RXBIST_TE_DWELL_TIME;   // 0.15
teChirpProfile.settleTimeTicks = RFE_SW_RXBIST_TE_SETTLE_TIME; // 2.3us;
teChirpProfile.txTransmissionEnable = RFE_TX_SELECT_NONE;
// Program Tx enable the same as TxTransmissionEnable, to keep tranmission enabling via TE working (This will not conflict with TX power management via PM unit)
teChirpProfile.txEnable = teChirpProfile.txTransmissionEnable;
teChirpProfile.txPhaseRotation[rfe_txIndex_1_e] = ( rfe_phaseRotation_t ) RFE_HW_TE_FUNC_ARG_TX_PHASE_ROTATION_MIN;
