cfloat32_t dftMeasuredTones[2];
rfeSwCalibration_rxTwoToneLevels_t filteredTones = refBistTones;

RFE_ERROR_GUARD
{
    /*
     * Calculate the bins where the tones are expected
     */
    uint32_t refTone1Bin = rfeSwCalibration_rxIfFrequencyToBin( refBistTones.f1,
                                                                swBistSamplingRate,
                                                                swBistFftSize,
                                                                RFE_ERROR_FUNCTION_ARGUMENT );
    uint32_t refTone2Bin = rfeSwCalibration_rxIfFrequencyToBin( refBistTones.f2,
                                                                swBistSamplingRate,
                                                                swBistFftSize,
                                                                RFE_ERROR_FUNCTION_ARGUMENT );


    // Perform DFT over input samples of the reference tones stored on dftMeasuredTones

    rfeDspMath_dftFast2BinsI16F( pDftSamples,
                                 31ul - __CLZ( swBistFftSize ),
                                 refTone1Bin,
                                 refTone2Bin,
                                 &dftMeasuredTones[0],
                                 RFE_ERROR_FUNCTION_ARGUMENT );

    // DFT results are not normalized, therefore the magnitude is divided by the number of samples
    filteredTones.v1 = ( float ) __VSQRT ( dftMeasuredTones[0].re * dftMeasuredTones[0].re  
                                           + dftMeasuredTones[0].im * dftMeasuredTones[0].im ) / swBistFftSize;
    filteredTones.v2 = ( float ) __VSQRT( dftMeasuredTones[1].re * dftMeasuredTones[1].re
                                          + dftMeasuredTones[1].im * dftMeasuredTones[1].im ) / swBistFftSize;


    // calculate the phase of the complex number input
    filteredTones.ph1 = ( float ) rfeDspMath_atan2F ( dftMeasuredTones[0].im,
                                                      dftMeasuredTones[0].re );
    filteredTones.ph2 = ( float ) rfeDspMath_atan2F( dftMeasuredTones[1].im,
                                                     dftMeasuredTones[1].re );
}

return filteredTones;

