case rfeSwBist_Id_ldo_xo_core_e:
    *pselectedAtbX = rfeHwAtb_atbMaster_1_e;
    pipToConnect->id = RFE_HW_SPI_MCGEN_MODULE;
    pipToConnect->atbCtlOffset = rfeHwAtb_ctlOffset_default_e;
    pipToConnect->atbCtlEnShf = RFE_HW_MCGEN_ATB_CTL1_ATB1_EN_BIT;
    pipToConnect->atbCtlMaskToApply = RFE_HW_MCGEN_ATB_CTL1_ATB1_SEL_MSK;
    pipToConnect->atbCtlSelShf = RFE_HW_MCGEN_ATB_CTL1_ATB1_SEL_SHF;
    *patbCtlSelValue = RFE_SW_BIST_ATBCTLSEL_LDO_XO_CORE;
    break;

default:
    RFE_ERROR_GUARD
    {
        RFE_ERROR_SET(rfe_error_param_invalidParam_e);
    }
}

