rfeHwSpi_register32_t atbCtl;

if (lldoId == rfeSwBist_Id_ldo_xo_core_e)
{
    atbCtl = rfeHwSpi_read(ipSpiModule,
                           RFE_HW_MCGEN_ATB_CTL2_REG,
                           RFE_ERROR_FUNCTION_ARGUMENT);
    if (enable)
    {
        atbCtl = rfeHwSpi_util_modifyShifted(atbCtl,
                                             RFE_HW_MCGEN_ATB_CTL2_ATB_XO_CTRL_CORE_MSK,
                                             AtbSubSel,
                                             RFE_HW_MCGEN_ATB_CTL2_ATB_XO_CTRL_CORE_SHF);
    }
    else
    {
        atbCtl = rfeHwSpi_util_modifyShifted(atbCtl,
                                             RFE_HW_MCGEN_ATB_CTL2_ATB_XO_CTRL_CORE_MSK,
                                             0x0u,
                                             RFE_HW_MCGEN_ATB_CTL2_ATB_XO_CTRL_CORE_SHF);
    }

    rfeHwSpi_write(ipSpiModule,
                   RFE_HW_MCGEN_ATB_CTL2_REG,
                   atbCtl,
                   RFE_ERROR_FUNCTION_ARGUMENT);
}
else
{
    atbCtl = rfeHwSpi_read(ipSpiModule,
                           RFE_HW_MCGEN_ATB_CTL2_REG,
                           RFE_ERROR_FUNCTION_ARGUMENT);

    if (enable)
    {
        atbCtl = rfeHwSpi_util_setBit(atbCtl, RFE_HW_MCGEN_ATB_CTL2_ATB_ADPLL_CTRL_ENA_BIT);
    }
    else
    {
        atbCtl = rfeHwSpi_util_clearBit(atbCtl, RFE_HW_MCGEN_ATB_CTL2_ATB_ADPLL_CTRL_ENA_BIT);
    }

    rfeHwSpi_write(ipSpiModule,
                   RFE_HW_MCGEN_ATB_CTL2_REG,
                   atbCtl,
                   RFE_ERROR_FUNCTION_ARGUMENT);

    atbCtl = rfeHwSpi_read(RFE_HW_SPI_ADC_PLL_MODULE,
                           RFE_HW_ADPLL_ATB_CONTROL_REG,
                           RFE_ERROR_FUNCTION_ARGUMENT);
    RFE_ERROR_GUARD
    {

        if (enable)
        {
            atbCtl = rfeHwSpi_util_modifyShifted(atbCtl,
                                                 RFE_HW_ADPLL_ATB_CONTROL_ATB_CONTROL_MSK,
                                                 AtbSubSel,
                                                 RFE_HW_ADPLL_ATB_CONTROL_ATB_CONTROL_SHF);
        }
        else
        {
            atbCtl = rfeHwSpi_util_modifyShifted(atbCtl,
                                                 RFE_HW_ADPLL_ATB_CONTROL_ATB_CONTROL_MSK,
                                                 0x0u,
                                                 RFE_HW_ADPLL_ATB_CONTROL_ATB_CONTROL_SHF);
        }

        rfeHwSpi_write(RFE_HW_SPI_ADC_PLL_MODULE,
                       RFE_HW_ADPLL_ATB_CONTROL_REG,
                       atbCtl,
                       RFE_ERROR_FUNCTION_ARGUMENT);
    }
}

