return voltageOut;

rfeHwFccu_sw_faultId_t errorId;

if ( LldoInd == rfeSwBist_Id_chirppll_ldo_pdiv_0v9_e)
{

    if (voltage < RFE_SW_BIST_OVERVOLTAGE_THRESHOLD_NEG) // overvoltage occurs
    {
        errorId = rfeSwBist_errorMapperForLldo(LldoInd, true, RFE_ERROR_FUNCTION_ARGUMENT);
        rfeHwFccu_triggerSwErrorId(errorId,
                                   rfeHwFccu_trigger_sw_error_type_set_e,
                                   RFE_ERROR_FUNCTION_ARGUMENT);
    }
    else if (voltage > RFE_SW_BIST_UNDERVOLTAGE_THRESHOLD_NEG) // undervoltage occurs
    {
        errorId = rfeSwBist_errorMapperForLldo(LldoInd, false, RFE_ERROR_FUNCTION_ARGUMENT);
        rfeHwFccu_triggerSwErrorId(errorId,
                                   rfeHwFccu_trigger_sw_error_type_set_e,
                                   RFE_ERROR_FUNCTION_ARGUMENT);
    }
    else
    {
        // DO NOTHING
    }
}
else if ( LldoInd == rfeSwBist_Id_ldo_xo_core_e)
{
    float mcGenTemperature = ((float) rfeHwTsense_getTemperature(rfe_temperatureSensorIndex_xo_e, RFE_ERROR_FUNCTION_ARGUMENT )) / (float) RFE_TEMPERATURE_1_DEG_CELSIUS;
    float maximumLimit = rfeSwBist_calcExpectedVoltageLimits(true,
                                                             mcGenTemperature,
                                                             RFE_ERROR_FUNCTION_ARGUMENT);
    float minimumLimit = rfeSwBist_calcExpectedVoltageLimits(false,
                                                             mcGenTemperature,
                                                             RFE_ERROR_FUNCTION_ARGUMENT);
    if ( voltage > ( maximumLimit*RFE_SW_BIST_XO_TOLERANCE_MAXIMUM_LIMIT ) ) // overvoltage occurs
    {
        errorId = rfeSwBist_errorMapperForLldo(LldoInd, true, RFE_ERROR_FUNCTION_ARGUMENT);
        rfeHwFccu_triggerSwErrorId(errorId,
                                   rfeHwFccu_trigger_sw_error_type_set_e,
                                   RFE_ERROR_FUNCTION_ARGUMENT);
    }
    else if ( voltage < ( minimumLimit*RFE_SW_BIST_XO_TOLERANCE_MINIMUM_LIMIT  ) ) // undervoltage occurs
    {
        errorId = rfeSwBist_errorMapperForLldo(LldoInd, false, RFE_ERROR_FUNCTION_ARGUMENT);
        rfeHwFccu_triggerSwErrorId(errorId,
                                   rfeHwFccu_trigger_sw_error_type_set_e,
                                   RFE_ERROR_FUNCTION_ARGUMENT);
    }
    else
    {
        // DO NOTHING
    }
}

else
{

    if (voltage > RFE_SW_BIST_OVERVOLTAGE_THRESHOLD) // overvoltage occurs
    {
        errorId = rfeSwBist_errorMapperForLldo(LldoInd, true, RFE_ERROR_FUNCTION_ARGUMENT);
        rfeHwFccu_triggerSwErrorId(errorId,
                                   rfeHwFccu_trigger_sw_error_type_set_e,
                                   RFE_ERROR_FUNCTION_ARGUMENT);
    }
    else if (voltage < RFE_SW_BIST_UNDERVOLTAGE_THRESHOLD) // undervoltage occurs
    {
        errorId = rfeSwBist_errorMapperForLldo(LldoInd, false, RFE_ERROR_FUNCTION_ARGUMENT);
        rfeHwFccu_triggerSwErrorId(errorId,
                                   rfeHwFccu_trigger_sw_error_type_set_e,
                                   RFE_ERROR_FUNCTION_ARGUMENT);
    }
    else
    {
        // DO NOTHING
    }
}

float voltage;
      if (maximum)
      {
          voltage= (float) (RFE_SW_BIST_XO_INTERCEPT_MAXIMUM_LIMIT + RFE_SW_BIST_XO_SLOPE_MAXIMUM_LIMIT * mcGenTemperature);
      }
      else
      {
          voltage= (float) (RFE_SW_BIST_XO_INTERCEPT_MINIMUM_LIMIT  + RFE_SW_BIST_XO_SLOPE_MINIMUM_LIMIT * mcGenTemperature);
      }

return voltage;

uint16_t codeOut = 0u;
/** Wait time */
RFE_WAIT_USEC(waitTime);
/** Read ADC results */
codeOut = ( uint16_t ) rfeHwAtb_funcAtbCollectSamples(selectedAtbX, RFE_ERROR_FUNCTION_ARGUMENT);
return codeOut;

RFE_ERROR_GUARD
{
    uint8_t pProfileMixerIbias = RFE_HW_RX_MIXER_IREF_DEFAULT;

    // Step 1: power RxBist IP
    rfeSwCalibration_rxCalibrationRxbistEnable( true, 
                                                false,
                                                RFE_SW_BIST_MCGEN_SWITCH_TIME_US, 
                                                RFE_ERROR_FUNCTION_ARGUMENT );

    // Step 3: LNA and mixer
    rfeHwRx_enableRfMixer( true, rfeHw_profileIndex_bist_e, &pProfileMixerIbias, RFE_ERROR_FUNCTION_ARGUMENT );
}

RFE_ERROR_GUARD
{
    // Configure TE
    rfeSwBist_rxConfigTe( rfeHw_profileIndex_bist_e,
                          pBistLocalParam->swBistFftSize,
                          RFE_ERROR_FUNCTION_ARGUMENT );

    // Configure BIST
    pBistLocalParam->rxActualBistTones = rfeSwCalibration_rxCalibrationRxbistSignalConfigure( pBistLocalParam->rxBistTones, RFE_ERROR_FUNCTION_ARGUMENT );
    rfeHwRxbist_triggerSignalStart( RFE_ERROR_FUNCTION_ARGUMENT );

    // Workaround for HW Bug in PDC
    rfeHwPdc_setIqSwap( false, RFE_ERROR_FUNCTION_ARGUMENT );

    //PDC Bit width to set to 16bit.       
    rfeHwSpi_module_t pdcAddrSPI = rfeHwPdc_indexMapperToSPIModule( rfe_rxIndex_1_e,
                                                                    RFE_ERROR_FUNCTION_ARGUMENT );
    rfeHwSpi_register32_t pdcCtl3 = rfeHwSpi_read( pdcAddrSPI, RFE_HW_PDC_PDC_CTL3_REG, RFE_ERROR_FUNCTION_ARGUMENT );

    rfe_pdcBitwidth_t currentpdcBitWidth = ( rfe_pdcBitwidth_t ) ( pdcCtl3 & RFE_HW_PDC_PDC_CTL3_OUTP_ROUND_MSK ) >> RFE_HW_PDC_PDC_CTL3_OUTP_ROUND_SHF;
    pBistLocalParam->rxBistPdcBackupBitWidth = rfe_pdcBitwidth_16bit_e - currentpdcBitWidth;

    // Set Bit Width to 16 bit in all PDCs
    if ( pBistLocalParam->rxBistPdcBackupBitWidth != pBistLocalParam->pdcBitWidth )
    {
        if( !rfeHwPdc_getMulticastModeOn() )
        {
            rfeHwPdc_multicastModeSetter( true, RFE_ERROR_FUNCTION_ARGUMENT );
        }
        else
        {
            // Nothing  PDC multicast is already on
        }
        rfeHwPdc_bitWidthSetter( rfe_rxIndex_1_e,
                                 pBistLocalParam->pdcBitWidth,
                                 RFE_ERROR_FUNCTION_ARGUMENT );
    }

    // Configure Packer
    rfeSwBist_savePackerConfig( &(pBistLocalParam->storePowerDownReg),
                                RFE_ERROR_FUNCTION_ARGUMENT );
    rfeHwPacker_configDataOutDestination( rfeHwPacker_dataOuput_wdma_e,
                                          RFE_ERROR_FUNCTION_ARGUMENT );

    // Configure WDMA
    // pBistLocalParam->swBistDataBuff +  RFE_DTCM_BASE_BD_OFFSET  -> the BackDoor offset is added in order for the WDMA module to be able to access the data memory
    rfeSwBist_configWDMA( RFE_ERROR_FUNCTION_ARGUMENT, rfeHwWdma_stream_0_e, ( pBistLocalParam->swBistDataBuff + RFE_DTCM_BASE_BD_OFFSET ), pBistLocalParam->swBistFftSize / 2ul );
    rfeSwBist_configWDMA( RFE_ERROR_FUNCTION_ARGUMENT, rfeHwWdma_stream_1_e, ( pBistLocalParam->swBistDataBuff + RFE_DTCM_BASE_BD_OFFSET ) + ( 2 * pBistLocalParam->swBistFftSize ), pBistLocalParam->swBistFftSize / 2ul );
    rfeSwBist_configWDMA( RFE_ERROR_FUNCTION_ARGUMENT, rfeHwWdma_stream_2_e, ( pBistLocalParam->swBistDataBuff + RFE_DTCM_BASE_BD_OFFSET ) + ( 4 * pBistLocalParam->swBistFftSize ), pBistLocalParam->swBistFftSize / 2ul );
    rfeSwBist_configWDMA( RFE_ERROR_FUNCTION_ARGUMENT, rfeHwWdma_stream_3_e, ( pBistLocalParam->swBistDataBuff + RFE_DTCM_BASE_BD_OFFSET ) + ( 6 * pBistLocalParam->swBistFftSize ), pBistLocalParam->swBistFftSize / 2ul );

    // preventing di/dt issues when loading the profile
    rfeHwTx_setTxBuf2b2cInAllTxsToAvoidGLDO2UndershootInPowerOn( rfe_txIndex_1_e, RFE_ERROR_FUNCTION_ARGUMENT );
    rfeHw_tuneGldo_loadProfile( rfeHw_profileIndex_bist_e,
                                RFE_ERROR_FUNCTION_ARGUMENT );
    rfeHwTx_fastEnablePrAndBuf2b2cInAllTxChannels( rfe_txIndex_1_e, false, RFE_ERROR_FUNCTION_ARGUMENT );

}

rfeHwRx_configRfbist_t rfConfig;
rfConfig.enableBuffer = false;
rfConfig.enablePpd = false;
rfConfig.enableVga = false;
rfConfig.selectVgaGain = rfeHwRx_Rfbist_Gain1x_e;
rfConfig.selIp = true;
rfConfig.selOp = true;

RFE_ERROR_GUARD
{
    /* Enable RX multicast support for all RX IF calibration. First check
    *  whether RX multicast is enabled, if it was not enabled activate it, if it was enabled don't
    */

    rfeHwRx_multicastModeSetter( true, RFE_ERROR_FUNCTION_ARGUMENT );
    if ( rxBistTestType == rfe_rxBist_lnaTest_e )
    {
        // Enable LNA and set switches to route RFBIST signal at the LNA input
        rfeHwRx_enableLna( true, rfeHw_profileIndex_bist_e, RFE_ERROR_FUNCTION_ARGUMENT );
        rfConfig.selIp = true;
        rfConfig.selOp = false;
    }
    else if( rxBistTestType == rfe_rxBist_mixerTest_e )
    {
        // Disable LNA to avoid RX injection and set switches to route RFBIST signal straight to the RX mixer
        rfConfig.selIp = true;
        rfConfig.selOp = true;
        rfeHwRx_enableLna( false, rfeHw_profileIndex_bist_e, RFE_ERROR_FUNCTION_ARGUMENT );
    }
    else
    {
        RFE_ERROR_SET( rfe_error_rxbistUnknownTestConf_e );
    }
    RFE_ERROR_GUARD
    {
