RFE_ERROR_GUARD { pBistLocalParam->measuredRefTones[ RFE_SW_BIST_CHANNEL_ZERO ] = rfeSwBist_rxIfPerformDftOfTones( pBistLocalParam->rxActualBistTones, ( int16x2_t* )( pBistLocalParam->swBistDataBuff), pBistLocalParam->swBistSamplingRate, pBistLocalParam->swBistFftSize, RFE_ERROR_FUNCTION_ARGUMENT );
pBistLocalParam->measuredRefTones[ RFE_SW_BIST_CHANNEL_ONE ] = rfeSwBist_rxIfPerformDftOfTones( pBistLocalParam->rxActualBistTones, ( int16x2_t* )( pBistLocalParam->swBistDataBuff + ( 2 * pBistLocalParam->swBistFftSize ) ), pBistLocalParam->swBistSamplingRate, pBistLocalParam->swBistFftSize, RFE_ERROR_FUNCTION_ARGUMENT );
pBistLocalParam->measuredRefTones[ RFE_SW_BIST_CHANNEL_TWO ] = rfeSwBist_rxIfPerformDftOfTones( pBistLocalParam->rxActualBistTones, ( int16x2_t* )( pBistLocalParam->swBistDataBuff + ( 4 * pBistLocalParam->swBistFftSize ) ), pBistLocalParam->swBistSamplingRate, pBistLocalParam->swBistFftSize, RFE_ERROR_FUNCTION_ARGUMENT );
pBistLocalParam->measuredRefTones[ RFE_SW_BIST_CHANNEL_THREE ] = rfeSwBist_rxIfPerformDftOfTones( pBistLocalParam->rxActualBistTones, ( int16x2_t* )( pBistLocalParam->swBistDataBuff + ( 6 * pBistLocalParam->swBistFftSize ) ), pBistLocalParam->swBistSamplingRate, pBistLocalParam->swBistFftSize, RFE_ERROR_FUNCTION_ARGUMENT ); }

RFE_ERROR_GUARD
{
    float diff1;
    float diff2;
    float phaseDiff1;
    float phaseDiff2;

    for ( uint8_t rxIdx = RFE_SW_BIST_MIN_RX_CHANNEL ; rxIdx < RFE_RX_COUNT ; rxIdx++ )
    {
        // Calculate difference between RX1 and all remaining RXs and convert from radians to degrees
        diff1 = ( pBistLocalParam->measuredRefTones[0].ph1 - pBistLocalParam->measuredRefTones[rxIdx].ph1 ) * ( RFE_SW_BIST_180_DEGREES / M_PI );
        diff2 = ( pBistLocalParam->measuredRefTones[0].ph2 - pBistLocalParam->measuredRefTones[rxIdx].ph2 ) * ( RFE_SW_BIST_180_DEGREES / M_PI );
        diff1 = rfeSwBist_normalizeAngleToPi( diff1 );
        diff2 = rfeSwBist_normalizeAngleToPi( diff2 );
        // if we have the zero day measurement store it in the zeroDay table
        if ( zeroDayMeasurement == true )
        {

            pRxBistParam->zeroDayMeasurementBuff.phDiff1[rxIdx - 1u] = diff1;
            pRxBistParam->zeroDayMeasurementBuff.phDiff2[rxIdx - 1u] = diff2;                
        }
        else
        {
            phaseDiff1 = RFE_DSP_MATH_ABS( rfeSwBist_normalizeAngleToPi( pRxBistParam->zeroDayMeasurementBuff.phDiff1[rxIdx - 1u] - diff1 ) );
            phaseDiff2 = RFE_DSP_MATH_ABS( rfeSwBist_normalizeAngleToPi( pRxBistParam->zeroDayMeasurementBuff.phDiff2[rxIdx - 1u] - diff2 ) );
            rfeSwBist_rxBistCheckAndThrowError( pRxBistParam,
                                                rxIdx, 
                                                true, 
                                                phaseDiff1, 
                                                phaseDiff2, 
                                                RFE_ERROR_FUNCTION_ARGUMENT );
        }
    }
}

float G1;
float G2;
float gainDiff1;
float gainDiff2;


RFE_ERROR_GUARD
{
    for (uint8_t rxIdx = RFE_SW_BIST_MIN_RX_CHANNEL; rxIdx < RFE_RX_COUNT; rxIdx++)
    {
        G1 = 20.0f * rfeDspMath_log10F( pBistLocalParam->measuredRefTones[0].v1 / pBistLocalParam->measuredRefTones[rxIdx].v1 );
        G2 = 20.0f * rfeDspMath_log10F( pBistLocalParam->measuredRefTones[0].v2 / pBistLocalParam->measuredRefTones[rxIdx].v2 );

        if ( zeroDayMeasurement == true )
        {
            pRxBistParam->zeroDayMeasurementBuff.G1[rxIdx - 1u] = G1;
            pRxBistParam->zeroDayMeasurementBuff.G2[rxIdx - 1u] = G2;
        }
        else
        {
            gainDiff1 = RFE_DSP_MATH_ABS( pRxBistParam->zeroDayMeasurementBuff.G1[rxIdx - 1u] - G1 );
            gainDiff2 = RFE_DSP_MATH_ABS( pRxBistParam->zeroDayMeasurementBuff.G2[rxIdx - 1u] - G2 );
            rfeSwBist_rxBistCheckAndThrowError( pRxBistParam,
                                                rxIdx,
                                                false,
                                                gainDiff1,
                                                gainDiff2,
                                                RFE_ERROR_FUNCTION_ARGUMENT );
        }
    }
}

