{
    float successiveDiff = pPhases[i] - pPhases[i - 1];
    successiveDiff = (successiveDiff > M_PI) ? (successiveDiff - 2 * M_PI) : (successiveDiff < -M_PI ? successiveDiff + 2 * M_PI : successiveDiff);
    pPhaseSteps[i - 1] = successiveDiff - 2 * M_PI / ( ( float ) RFE_SW_BIST_TXBIST_SAMPLES_COUNT );
}

