        RFE_ERROR_SET(rfe_error_param_invalidParam_e);
    }
    break;
}
#endif
bool startStopSampling;
startStopSampling = true;
rfeHwAtb_funcAtbAdcTriggerContSampling(selectedAtbX,
                                       startStopSampling,
                                       RFE_ERROR_FUNCTION_ARGUMENT);
RFE_ERROR_GUARD
{
    uint8_t k = 0u;
    for (uint8_t iper = 0u; iper < RFE_SW_BIST_TXBIST_PERIODS_COUNT; iper++) // sweep over the number of periods (actually one period is chosen)
    {
        for (uint8_t isamp = 0u; isamp < RFE_SW_BIST_TXBIST_SAMPLES_COUNT; isamp++) // sweep over one period with 8 samples==> step=16u
        {
            txRefPhase = 16u * isamp; // Sweep TxRefPhase for one period [0:45:360[ in case of 8 samples, which is equivalent to sweep in [0:16:128[ (128=2^7)
            overRidePrPhase = true;
            /** Override the tx ref phase*/
            rfeHwTx_overridePrPhaseSetter(txRef,
                                          overRidePrPhase,
                                          txRefPhase,
                                          RFE_ERROR_FUNCTION_ARGUMENT);
#ifdef RFE_BUILD_FUSA_VAL_FW
            switch (txBistInd)
            {
                case rfeSwBist_txBistIndex_1_e:

                    if ( txRef == rfe_txIndex_1_e )
                    {
                        if ( isamp == 0ul )
                        {
                            /* isamp 0 corresponds to Zero Degree*/
                            rfeValHook_executeHook( rfeValHook_hookID_txBistPhaseStepZeroDegree_tx12_e, RFE_ERROR_FUNCTION_ARGUMENT );
                        }
                        else if ( isamp == 2ul )
                        {
                            /* isamp 2*45 corresponds to Ninety Degree*/
                            rfeValHook_executeHook( rfeValHook_hookID_txBistPhaseStepNinetyDegree_tx12_e, RFE_ERROR_FUNCTION_ARGUMENT );
                        }
                        else
                        {
                            //Do nothing
                        }
                    }

                   else
                   {
                        if ( isamp == 0ul )
                        {
                            /* isamp 0 corresponds to Zero Degree*/
                            rfeValHook_executeHook( rfeValHook_hookID_txBistPhaseStepZeroDegree_tx21_e, RFE_ERROR_FUNCTION_ARGUMENT );
                        }
                        else if ( isamp == 2ul )
                        {
                            /* isamp 2*45 corresponds to Ninety Degree*/
                            rfeValHook_executeHook( rfeValHook_hookID_txBistPhaseStepNinetyDegree_tx21_e, RFE_ERROR_FUNCTION_ARGUMENT );    
                        }
                        else
                        {
                            //Do nothing
                        }
                   }

                break;
                case rfeSwBist_txBistIndex_2_e:
                    if ( isamp == 0ul)
                    {
                        rfeValHook_executeHook( rfeValHook_hookID_txBistPhaseStepZeroDegree_tx23_e, RFE_ERROR_FUNCTION_ARGUMENT );
                    }
                    else if ( isamp == 2ul)
                    {
                        rfeValHook_executeHook( rfeValHook_hookID_txBistPhaseStepNinetyDegree_tx23_e, RFE_ERROR_FUNCTION_ARGUMENT );

                    }
                break;
                case rfeSwBist_txBistIndex_3_e:
                    if ( isamp == 0ul)
                    {
                        rfeValHook_executeHook( rfeValHook_hookID_txBistPhaseStepZeroDegree_tx34_e, RFE_ERROR_FUNCTION_ARGUMENT );
                    }
                    else if ( isamp == 2ul)
                    {
                        rfeValHook_executeHook( rfeValHook_hookID_txBistPhaseStepNinetyDegree_tx34_e, RFE_ERROR_FUNCTION_ARGUMENT );
                    }
                break;
                default:
                RFE_ERROR_GUARD
                {
                    RFE_ERROR_SET(rfe_error_param_invalidParam_e);
                }
                break;
            }
#endif
            Codeout = rfeSwBist_readAtbAdcValue(selectedAtbX,
                                                RFE_SWBIST_TXBIST_WAIT_TIME,
                                                RFE_ERROR_FUNCTION_ARGUMENT);
            /** convert Codeout to voltage*/
            float SampleOut = ( float ) rfeHwAtb_funcAtbAdcSamplesToVoltageConvert(Codeout,
                                                                                selectedAtbX,
                                                                                RFE_SWBist_ADC_ENDING_MODE,
                                                                                RFE_SWBist_TXBIST_ADC_GAIN_MODE,
                                                                                RFE_ERROR_FUNCTION_ARGUMENT);


            IfSignalMeas[k] = SampleOut;
            k++;
        }
    }
    startStopSampling = false;
    rfeHwAtb_funcAtbAdcTriggerMonoSampling(selectedAtbX,
                                           startStopSampling,
                                           RFE_ERROR_FUNCTION_ARGUMENT);
    overRidePrPhase = false;
    rfeHwTx_overridePrPhaseSetter(txToMeasure,
                                  overRidePrPhase,
                                  txToMeasurePhase,
                                  RFE_ERROR_FUNCTION_ARGUMENT);
    rfeHwTx_overridePrPhaseSetter(txRef,
                                  overRidePrPhase,
                                  txRefPhase,
                                  RFE_ERROR_FUNCTION_ARGUMENT);
}
rfeSwBist_enableTxBistLevelShifter( ( rfe_txIndex_t ) ( rfeSwBist_mapTxBistIndexToTxIndex(txBistInd, RFE_ERROR_FUNCTION_ARGUMENT) ), false, RFE_ERROR_FUNCTION_ARGUMENT);
rfeHwTx_subcomponentEnabling( ( rfe_txIndex_t ) ( rfeSwBist_mapTxBistIndexToTxIndex(txBistInd, RFE_ERROR_FUNCTION_ARGUMENT) ), rfeHwTx_subcomponent_BIST_e, false, RFE_ERROR_FUNCTION_ARGUMENT);

float calculatedPhaseDeg = 0.0f;
float calculatedPhaseRad = 0.0f;

calculatedPhaseRad = ( float ) rfeDspMath_atan2F(fftResult[1].im,
                                               fftResult[1].re);
calculatedPhaseDeg = calculatedPhaseRad * 180.0f / M_PI;
calculatedPhaseDeg = ( float ) rfeSwBist_normalizeAngleToPi( calculatedPhaseDeg );
return calculatedPhaseDeg;

int16_t res[RFE_SW_BIST_TXBIST_SAMPLES_COUNT];
for (uint8_t iper = 0u; iper < RFE_SW_BIST_TXBIST_SAMPLES_COUNT; iper++)
{
    IfSignalMeas[iper] = IfSignalMeas[iper] / 2000.0f;
}
rfeDspMath_floatToQ15Array( &IfSignalMeas[0], RFE_SW_BIST_TXBIST_SAMPLES_COUNT, 15ul, &res[0], RFE_ERROR_FUNCTION_ARGUMENT);
rfeDspMath_fftI16F( (int16x2_t *) res, RFE_SAMPLE_COUNT_POWER_OVER_TWO , &fftResult[0], RFE_ERROR_FUNCTION_ARGUMENT);

cfloat32_t hilbertTrasformResult[RFE_SW_BIST_TXBIST_SAMPLES_COUNT];
float calculatedInstantaneousPhasesRad[RFE_SW_BIST_TXBIST_SAMPLES_COUNT];
float phaseStepsDeg[RFE_SW_BIST_TXBIST_SAMPLES_COUNT];
cfloat32_t fullFftResult[RFE_SW_BIST_TXBIST_SAMPLES_COUNT];
cint16_t reconstructedFftResult[RFE_SW_BIST_TXBIST_SAMPLES_COUNT];
float phaseStepsRad[RFE_SW_BIST_TXBIST_SAMPLES_COUNT - 1];

for (uint8_t iper = 0u; iper < RFE_SW_BIST_TXBIST_SAMPLES_COUNT / 2; iper++)
{
    fullFftResult[iper].re = fftResult[iper].re;
    fullFftResult[iper].im = fftResult[iper].im;
    fullFftResult[RFE_SW_BIST_TXBIST_SAMPLES_COUNT / 2 + iper].re = fftResult[RFE_SW_BIST_TXBIST_SAMPLES_COUNT / 2 - iper].re;
    fullFftResult[RFE_SW_BIST_TXBIST_SAMPLES_COUNT / 2 + iper].im = -fftResult[RFE_SW_BIST_TXBIST_SAMPLES_COUNT / 2 - iper].im;
}
fullFftResult[0].im = 0.0f;
fullFftResult[RFE_SW_BIST_TXBIST_SAMPLES_COUNT / 2].im = 0.0f;
fullFftResult[RFE_SW_BIST_TXBIST_SAMPLES_COUNT / 2].re = fftResult[0].im;

bool pSaturated;
uint8_t nFractionBits = 1ul;
reconstructedFftResult[0].re = ( int16_t ) rfeDspMath_floatToQ15(fullFftResult[0].re, nFractionBits, &pSaturated);
reconstructedFftResult[0].im = ( int16_t ) rfeDspMath_floatToQ15(fullFftResult[0].im, nFractionBits, &pSaturated);
for (uint8_t iper = 1u; iper < RFE_SW_BIST_TXBIST_SAMPLES_COUNT / 2; iper++)
{
    reconstructedFftResult[iper].re = ( int16_t ) rfeDspMath_floatToQ15(0.0f, nFractionBits, &pSaturated);
    reconstructedFftResult[iper].im = ( int16_t ) rfeDspMath_floatToQ15(0.0f, nFractionBits, &pSaturated);
}
reconstructedFftResult[RFE_SW_BIST_TXBIST_SAMPLES_COUNT / 2].re = ( int16_t ) rfeDspMath_floatToQ15(fullFftResult[RFE_SW_BIST_TXBIST_SAMPLES_COUNT / 2].re, nFractionBits, &pSaturated);
reconstructedFftResult[RFE_SW_BIST_TXBIST_SAMPLES_COUNT / 2].im = ( int16_t ) rfeDspMath_floatToQ15(fullFftResult[RFE_SW_BIST_TXBIST_SAMPLES_COUNT / 2].im, nFractionBits, &pSaturated);
for (uint8_t iper = RFE_SW_BIST_TXBIST_SAMPLES_COUNT / 2 + 1; iper < RFE_SW_BIST_TXBIST_SAMPLES_COUNT; iper++)
{
    reconstructedFftResult[iper].re = ( int16_t ) rfeDspMath_floatToQ15(2.0f * fullFftResult[RFE_SW_BIST_TXBIST_SAMPLES_COUNT - iper].re, nFractionBits, &pSaturated);
    reconstructedFftResult[iper].im = ( int16_t ) rfeDspMath_floatToQ15(2.0f * fullFftResult[RFE_SW_BIST_TXBIST_SAMPLES_COUNT - iper].im, nFractionBits, &pSaturated);
}

rfeDspMath_cfftC16F( &reconstructedFftResult[0], RFE_SAMPLE_COUNT_POWER_OVER_TWO, &hilbertTrasformResult[0], RFE_ERROR_FUNCTION_ARGUMENT);

rfeDspMath_angleCFloatArray( &hilbertTrasformResult[0], RFE_SW_BIST_TXBIST_SAMPLES_COUNT, &calculatedInstantaneousPhasesRad[0], RFE_ERROR_FUNCTION_ARGUMENT);

rfeSwBist_calculatePhaseStepsDeviation( &calculatedInstantaneousPhasesRad[0], &phaseStepsRad[0], RFE_ERROR_FUNCTION_ARGUMENT);

for (uint8_t iper = 0u; iper < RFE_SW_BIST_TXBIST_SAMPLES_COUNT - 1; iper++)
{
    phaseStepsDeg[iper] = (RFE_DSP_MATH_ABS(phaseStepsRad[iper] * 180.0f / M_PI));
}

float maximumPhaseStepDiff = phaseStepsDeg[0u];
for (uint8_t iper = 1u; iper < RFE_SW_BIST_TXBIST_SAMPLES_COUNT - 1; iper++)
{
    if (phaseStepsDeg[iper] > maximumPhaseStepDiff)
    {
        maximumPhaseStepDiff = phaseStepsDeg[iper];
    }
}

return maximumPhaseStepDiff;

rfe_txIndex_t txToMeasure;
rfe_txIndex_t txRef;
rfe_phaseRotation_t txToMeasurePhase;
rfeHwAtb_atbMaster_t selectedAtbX;
float IfSignalMeas[RFE_SW_BIST_TXBIST_SAMPLES_COUNT];
cfloat32_t fftResult[RFE_SW_BIST_TXBIST_SAMPLES_COUNT / 2];
float phaseDiffDeviation;
txToMeasure = 0ul;
txRef = 0ul;
txToMeasurePhase = 0u; // phase rotator =0 to avoid INL/DNL deviation (when the phase is different from 0 INL/DNL occurs)
selectedAtbX = rfeHwAtb_atbMaster_2_e;
if (doExtraMeasureForPhaseStep == true)
{
    switch (txBistInd)
    {
        case rfeSwBist_txBistIndex_1_e:
            txToMeasure = rfe_txIndex_2_e;
            txRef = rfe_txIndex_1_e;
        break;
        case rfeSwBist_txBistIndex_2_e:
            txToMeasure = rfe_txIndex_3_e;
            txRef = rfe_txIndex_2_e;
        break;
        case rfeSwBist_txBistIndex_3_e:
            txToMeasure = rfe_txIndex_4_e;
            txRef = rfe_txIndex_3_e;
        break;
        default:
            RFE_ERROR_GUARD
            {
                RFE_ERROR_SET(rfe_error_param_invalidParam_e);
            }
        break;
    }
}
else
{
    switch (txBistInd)
    {
        case rfeSwBist_txBistIndex_1_e:
            txToMeasure = rfe_txIndex_1_e;
            txRef = rfe_txIndex_2_e;
        break;
        case rfeSwBist_txBistIndex_2_e:
            txToMeasure = rfe_txIndex_2_e;
            txRef = rfe_txIndex_3_e;
        break;
        case rfeSwBist_txBistIndex_3_e:
            txToMeasure = rfe_txIndex_3_e;
            txRef = rfe_txIndex_4_e;
        break;
        default:
            RFE_ERROR_GUARD
            {
                RFE_ERROR_SET(rfe_error_param_invalidParam_e);
            }
        break;
    }
}

rfeSwBist_setTxBistVgaGain( pTxBistParam,
                            txBistInd,
                            RFE_ERROR_FUNCTION_ARGUMENT );

rfeSwBist_measureTxBistIfSignalSamples(selectedAtbX,
                                       IfSignalMeas,
                                       txBistInd,
                                       txToMeasure,
                                       txRef,
                                       txToMeasurePhase,
                                       RFE_ERROR_FUNCTION_ARGUMENT);

rfeSwBist_calculateFftOfIfSignal(IfSignalMeas, fftResult, RFE_ERROR_FUNCTION_ARGUMENT);

if (zeroHourMeasurement)
{

    pTxBistParam->zeroHourPhaseMeas[txBistInd] = ( float ) rfeSwBist_calculateIfSignalPhase(fftResult,
                                                                                            RFE_ERROR_FUNCTION_ARGUMENT);
}
else
{

    if ((phaseDifferenceTest) && (phaseStepTest))
    {

        if (doExtraMeasureForPhaseStep)
        {
            pTxBistParam->maximumPhaseStepDeviation[txRef] = ( float ) rfeSwBist_calculateMaximumPhaseStepDeviation(fftResult,
                                                                                                                    RFE_ERROR_FUNCTION_ARGUMENT);
            rfeSwBist_checkAndThrowErrorForTxBistPhaseStep(txRef,
                                                           pTxBistParam,
                                                           pTxBistParam->maximumPhaseStepDeviation[txRef],
                                                           RFE_ERROR_FUNCTION_ARGUMENT);
        }
        else
        {
            pTxBistParam->phaseMeas[txBistInd] = ( float) rfeSwBist_calculateIfSignalPhase(fftResult,
                                                                                           RFE_ERROR_FUNCTION_ARGUMENT);
            phaseDiffDeviation = pTxBistParam->phaseMeas[txBistInd] - pTxBistParam->zeroHourPhaseMeas[txBistInd];
            pTxBistParam->phaseDiffDeviation[txBistInd]= ( float ) rfeSwBist_normalizeAngleToPi( phaseDiffDeviation );
            rfeSwBist_checkAndThrowErrorForTxBistPhaseDiff(txBistInd,
                                                           pTxBistParam,
                                                           RFE_DSP_MATH_ABS(phaseDiffDeviation),
                                                           RFE_ERROR_FUNCTION_ARGUMENT);
            pTxBistParam->maximumPhaseStepDeviation[txRef] = ( float ) rfeSwBist_calculateMaximumPhaseStepDeviation(fftResult,
                                                                                                                    RFE_ERROR_FUNCTION_ARGUMENT);
            rfeSwBist_checkAndThrowErrorForTxBistPhaseStep(txRef,
                                                           pTxBistParam,
                                                           pTxBistParam->maximumPhaseStepDeviation[txRef],
                                                           RFE_ERROR_FUNCTION_ARGUMENT);
        }
    }
    else
    {
        if (phaseDifferenceTest)
        {
            pTxBistParam->phaseMeas[txBistInd] = ( float ) rfeSwBist_calculateIfSignalPhase(fftResult,
                                                                                            RFE_ERROR_FUNCTION_ARGUMENT);
            phaseDiffDeviation = pTxBistParam->phaseMeas[txBistInd] - pTxBistParam->zeroHourPhaseMeas[txBistInd];
            pTxBistParam->phaseDiffDeviation[txBistInd]= ( float ) rfeSwBist_normalizeAngleToPi( phaseDiffDeviation );
            rfeSwBist_checkAndThrowErrorForTxBistPhaseDiff(txBistInd,
                                                           pTxBistParam,
                                                           RFE_DSP_MATH_ABS(phaseDiffDeviation),
                                                           RFE_ERROR_FUNCTION_ARGUMENT);
        }
        else
        {
            pTxBistParam->maximumPhaseStepDeviation[txRef] = ( float ) rfeSwBist_calculateMaximumPhaseStepDeviation(fftResult,
                                                                                                                    RFE_ERROR_FUNCTION_ARGUMENT);
            rfeSwBist_checkAndThrowErrorForTxBistPhaseStep(txRef,
                                                           pTxBistParam,
                                                           pTxBistParam->maximumPhaseStepDeviation[txRef],
                                                           RFE_ERROR_FUNCTION_ARGUMENT);
        }
    }
}

rfeHwFccu_sw_faultId_t errorId = rfeSwBist_errorMapperForTxBistPhaseDiff(txBistIndex, RFE_ERROR_FUNCTION_ARGUMENT);
if (diff > pTxBistParam->phaseDiffThreshold)
{
    rfeHwFccu_triggerSwErrorId(errorId,
                               rfeHwFccu_trigger_sw_error_type_set_e,
                               RFE_ERROR_FUNCTION_ARGUMENT);
}

rfeHwFccu_sw_faultId_t errorId = rfeSwBist_errorMapperForTxBistPhaseStep( txIndex, RFE_ERROR_FUNCTION_ARGUMENT );
if ( diff > pTxBistParam->phaseStepThreshold )
{
    rfeHwFccu_triggerSwErrorId(errorId,
                               rfeHwFccu_trigger_sw_error_type_set_e,
                               RFE_ERROR_FUNCTION_ARGUMENT);
}

rfe_txIndex_t txindex = 0ul;

RFE_ERROR_GUARD
{
    switch (txBistInd)
    {
        case rfeSwBist_txBistIndex_1_e:
            txindex = rfe_txIndex_1_e;
        break;
        case rfeSwBist_txBistIndex_2_e:
            txindex = rfe_txIndex_2_e;
        break;
        case rfeSwBist_txBistIndex_3_e:
            txindex = rfe_txIndex_3_e;
        break;
        default:
            RFE_ERROR_SET(rfe_error_param_invalidParam_e);
        break;
    }
}

return txindex;

uint16_t codeOut = 0u;
/** Wait time */
RFE_WAIT_USEC( waitTime );
/** Read ADC results */
codeOut = ( uint16_t ) rfeHwAtb_funcAtbCollectSamples(selectedAtbX, RFE_ERROR_FUNCTION_ARGUMENT);
return codeOut;
